import React from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import '../css/navbar.css';
import '../js/navbarside';
import Logo from '../img/logo.png';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faSearch, faHome, faBook, faKey, faUsers, faCalendar, faFlag } from '@fortawesome/fontawesome-free-solid';
import Courses from './Courses';

function Navbar() {
  return (
    <div className='container-fluid'>
        <div className='nav-top'>
            <img src={Logo} alt="logo" />
            <div className='search-input'>
              <FontAwesomeIcon icon={faSearch} style={{
                  marginLeft: 10,
                  marginRight: 10,
                  marginTop: 11,
                  color: '#626262',
              }}/>
              <input type="search" placeholder="Search"/>
            </div>
            <div className='nav-button'>
              <a href='#'>Sign in</a>
              <a href='#' className=''>Sign up</a>
            </div>
        </div>
        <Router>
        <div className='nav-side' id='navbar-side'>
          <ul>
            <Link  to="/">
              <li className='list-btn active'>
                <FontAwesomeIcon icon={faHome} style={{
                    marginRight: 10,
                }}/>
                Home
              </li>
            </Link>
            <Link to="/courses">
              <li className='list-btn'>
                <FontAwesomeIcon icon={faBook}  style={{
                    marginRight: 10,
                }}/>
                Courses
              </li>
            </Link>
            <li className='list-btn'>
              <FontAwesomeIcon icon={faKey}  style={{
                  marginRight: 10,
              }}/>
              Transactions
            </li>
            <li className='list-btn'>
              <FontAwesomeIcon icon={faUsers}  style={{
                  marginRight: 10,
              }}/>
              Members
            </li>
            <li className='list-btn'>
              <FontAwesomeIcon icon={faCalendar}  style={{
                  marginRight: 10,
              }}/>
              Membership Catalog
            </li>
            <li className='list-btn'>
              <FontAwesomeIcon icon={faFlag}  style={{
                  marginRight: 10,
              }}/>
              Terms of Service
            </li>
          </ul>
        </div>
        <div className='content'>
          <Routes>
            <Route path="/" element={<Home />}></Route>
            <Route path="/courses" element={<Courses />}></Route>
          </Routes>
        </div>
        </Router>
    </div>
  )
}


export default Navbar
